import React from 'react';
import './LesionLens.css';

function ModelDetails() {
  return (
    <div className="lesion-lens-container">
      <h1 className="lesion-header">Data Sources</h1>
      <hr className="divider" />
      <p className="lesion-text">
        The image data we used come from the ISIC 2019 Challenge training Dataset. The datasets that make up this set
        are the BCN_20000 Dataset, the HAM10000 Dataset, and the MSK Dataset.
      </p>

      <h1 className="lesion-header">Image Data Processing</h1>
      <hr className="divider" />
      <p className="lesion-text">
        All images fed into our model underwent the following processing: first we resize the image, then we run a noise
        removal function that eliminates hair and other such noise, then we run a masking predictor to essentially
        blackout the skin surrounding the lesion, and then we normalize the RGB values. Your input image will undergo
        the same such processing before being fed into our model. Please also note that our backend ensures that your
        image is not stored anywhere to maintain ultimate privacy.
     </p>
    </div>
  );
}

export default LesionLens;
